import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
const AddPost = () => {
  return (
    <form>
      <TextField
        label="Post Title"
        fullWidth
        sx={{ mb: 2 }}
        name="title"
        helperText="Post title must contain 7-70 chars"
      />
      <TextField
        label="Post Content"
        name="content"
        fullWidth
        multiline
        rows={6}
        sx={{ mb: 2 }}
        helperText="Post content must contain 7-2000 chars"
      />
      <Button type="submit" fullWidth variant="contained"></Button>
    </form>
  );
};

export default AddPost;
